import React from 'react';
import './SplitScreen.css';

export default function SplitScreen({ leftWidth = 1, rightWidth = 1, children }) {
  const [LeftPanel, RightPanel] = children;

  return (
    <div className="split-screen-container">
      <div className="left-panel" style={{ flex: leftWidth }}>
        {LeftPanel}
      </div>
      <div className="right-panel" style={{ flex: rightWidth }}>
        {RightPanel}
      </div>
    </div>
  );
}
